import React from 'react'
import { Carousel } from 'react-responsive-carousel'
import styles from 'react'

function ProductCarousel({image}) {
    return (
        <Carousel>
            <div>
                <img src={image} alt='' />
            </div>
        </Carousel>
    )
}

export default ProductCarousel
